import React from 'react';
import { Container, Card, Col, Image } from 'react-bootstrap';


const Home:React.FC = () => {
    return (
     <Container className='mt-5'>
     <h1>  Ionut <br/> Ciornei</h1>
          <Col xs={6} md={4} style={{position:'absolute', right:'100px', top:'70px'}}>
          <Image src="/img/me.jpg" alt='me' style={{borderRadius:'20px'}} />
        </Col> 
     </Container>      
    )
};

export default Home;
